import { Component } from 'react';
import axios from 'axios';
import raw from '../Data/failas.txt';

export class ListOfListings extends Component {

    constructor(props){
        super(props);
        this.state = {
            listings: []
        }
    }

    componentDidMount()
    {

        var listings;
        fetch(raw)
            .then(r => r.text())
            .then(text => {
                this.setState({ listings });
            });
        
        
        console.log(listings);

    }

    render()
    {
        return (

            <ul>
                {
                    this.state.listings
                        .map(listing =>
                            <li key={listing.FirstName}>{listing.LastName}</li>
                        )
                }
            </ul>
        );
    }


}
